require 'pry'

def collapse(arr)
  arr.each_index do |i|
    l = i
    r = i + 1

    next if arr[l].nil?

    while arr[l].swapcase == arr[r]
      arr[l] = nil
      arr[r] = nil

      break if l.zero? || r == arr.size - 1

      l -= 1
      r += 1
      break if arr[l].nil? || arr[r].nil?
    end
  end

  arr.compact
end

def run(input)
  arr = input.chars

  done = false
  until done
    size = arr.size
    arr = collapse(arr)
    done = arr.size == size
  end

  arr.join
end

def run_tests
  test_data = [
    %w[abBdcCDeeF aeeF],
    %w[dabAcCaCBAcCcaDA dabCBAcaDA],
    %w[aabAAB aabAAB]
  ]

  test_data.each do |test|
    actual = run(test[0])
    if actual == test[1]
      puts "✅ #{actual} eq #{test[1]}"
    else
      puts "❌ expected #{actual} to eq #{test[1]}"
    end
  end
end

run_tests

